import React, { useState } from "react";

let images=[
    "https://img.freepik.com/free-photo/wide-angle-shot-single-tree-growing-clouded-sky-during-sunset-surrounded-by-grass_181624-22807.jpg?size=626&ext=jpg&ga=GA1.1.1826414947.1699228800&semt=sph",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://i0.wp.com/bestiu.edu.in/innovation/wp-content/uploads/2020/12/conservation-of-nature-1.jpg?fit=1000%2C530&ssl=1"
] 

 
function Slider(){
    let[state,setState]=useState(images)
    let [Count,Setcount]=useState(0)


    let nextimage=()=> {
Setcount(Count+1) 
     if(Count===images.length-1  ) {
        Setcount(Count=0)
     }
    
    
    }
    let previousimage=()=> {
        Setcount(Count-1)
        if(Count===0) {
            Setcount(Count=images.length-1)

        }
        }

  return(
        <div>
            <img  style={{width:"200px", height:"200px"}}
            src={state[Count] } alt="" />
            <div>
            <button onClick={nextimage}>Next</button>
            <button onClick={previousimage}>Previous</button>
            </div>
        </div>
    )
}
export default Slider